import React, { useState, useEffect } from "react"
import "./Devui.css"
import { Row, Col, Form } from "react-bootstrap"
import Navigation from "./Navigation"

const Devui = () => {

    const [internname, setInternname] = useState("")

    useEffect(() => {


        fetch( "https://reqres.in/api/users?page=2", {
            method: 'GET',
        })
            .then((apidata1) => {
                return apidata1.json()
            })
            .then((actualdata1) => {
                console.log(actualdata1)
                
            }
            )
    }, [])

    return (
        <>
            <Row className="mb-5">
                <Navigation />
            </Row>
            <Row className="listingpgtopbg mt-4">
                <Col sm={4} className="internname mt-5 ">
                    {internname}
                </Col>
                <Col sm>
                    456
                </Col>
            </Row>

            <Row>
                <Col sm={4}>
                    <Row className="listingpgfilterhead">
                        Category/Specialization
                    </Row>
                    <Row className="mt-3">
                        <select >
                            <option>Select</option>
                        </select>
                    </Row>
                </Col>
                <Col sm={8}></Col>
            </Row>

        </>
    )
}

export default Devui
